import React from 'react'
import styled from 'styled-components'

export const Logocontext = React.createContext()

export const Logo = () =>
{
    return(
        <Frame>Cov-Live</Frame>
    )
}
const Frame = styled.div`
width : 100px;
height : fit-content;
padding : 5px 0 ;
background:#706bfa;
mix-blend-mode : difference`
